import React from "react";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function Home() {
  return (
    <div className = "homepage">
      <div className="intro">
        <h1 className = "firstPageDivs">Pierce Butler</h1>
        <h1 className = "firstPageDivs">Software Engineer</h1>
        <h1 className = "firstPageDivs">Front-end Enthusiast</h1>
      </div>
      <Router>
      <div className="links">
        <Link to ="/about" className = "firstPageDivs">About Me</Link>
        <h1 className = "firstPageDivs">Portfolio</h1>
        <h1 className = "firstPageDivs">Contact me</h1>
        </div>
      </Router>
    </div>
  );
}

export default Home;
